  false,\n\t\"url\": null,\n\t\"notes\": \"Binary point-cloud data for part of the
  Suncook River in New Hampshire were produced from remotely sensed, geographically
  referenced elevation measurements by the U.S. Geological Survey, in cooperation
  with the New Hampshire Geological Survey. Elevation measurements were collected
  over the area on November 5 and 6, 2013 using the second-generation Experimental
  Advanced Airborne Research Lidar, a pulsed laser ranging system mounted onboard
  an aircraft to measure ground elevation, vegetation canopy, and coastal topography.
  The system uses high-frequency laser beams directed at the Earth's surface through
  an opening in the bottom of the aircraft's fuselage. The laser system records the
  time difference between emission of the laser beam and the reception of the reflected
  laser signal in the aircraft. The plane travels over the target area at approximately
  55 meters per second at an elevation of approximately 300 meters, resulting in a
  laser swath of approximately 240 meters. A peak sampling rate of 15u009630 kilohertz
  results in an extremely dense spatial elevation dataset. More than 100 kilometers
  of coastline can be surveyed easily within a 3- to 4-hour mission. When resultant
  elevation maps for an area are analyzed, they provide a useful tool to make management
  decisions regarding land development.\",\n\t\"license_title\": null,\n\t\"extras\":
